import React,{useState} from 'react'
import './setting.css'
import Clock from './clock'
import Form from './form'
function setting(){
  const [activeForm,setActiveForm]=useState('#Linux')
  const toggleForm = (type) => {
    setActiveForm(type);
    if(activeForm == "#Linux"){
      document.getElementById('linux').style.display="";
      document.getElementById('pi').style.display="none";
      document.getElementById('debian').style.display="none";
      document.getElementById('windows').style.display="none";
    }
    else if(activeForm == "#Pi"){
      document.getElementById('linux').style.display="none";
      document.getElementById('pi').style.display="";
      document.getElementById('debian').style.display="none";
      document.getElementById('windows').style.display="none";
    }
    else if(activeForm == "#Debian"){
      document.getElementById('linux').style.display="none";
      document.getElementById('pi').style.display="none";
      document.getElementById('debian').style.display="";
      document.getElementById('windows').style.display="none";
    }
    else if(activeForm == "#Windows"){
      document.getElementById('linux').style.display="none";
      document.getElementById('pi').style.display="none";
      document.getElementById('debian').style.display="none";
      document.getElementById('windows').style.display="";
    }
  }
return (
  <section id={"setting"}>
    <div className="apps">
      <div className="header">
        <div className="home">
          <img src="" alt="" />
        </div>
      <div className="header-menu"></div>
      <div className="Analog-clock">
        <Clock/> 
      </div>
      <div className="header-profile">
        <img className="profile-img" src={``} alt="" />
      </div>
    </div>
    <div className="wrapper">
      <div className="left-side">
        <div className="side-wrapper">
          <div className="side-title">Apps</div>
          <div className="side-menu">
            <a href='#Linux' onClick={()=>toggleForm("#Linux")} className={activeForm ==='#Linux'?'active' :''}>
              <img className='oos' src = "data:image/png;base64,"/>
            </a>
            <a href='#Pi' onClick={()=> toggleForm('#Pi')} className={activeForm ==='#Pi'?'active' :''}>
              <img className='oos' src = "data:image/png;base64,"/>
            </a>
            <a href='#Debian' onClick={()=>toggleForm('#Debian')} className={activeForm ==='#Debian'?'active' :''}>
              <img className='oos' src = "data:image/png;base64,"/>
            </a>
            <a href='#Windiws' onClick={()=> toggleForm('#Windiws')} className={activeForm ==='#Windiws'?'active' :''}>
              <img className='oos' src = "data:image/png;base64,"/>
            </a>
          </div>
        </div>
      </div>
      <div className='right-side'>
        <span id="linux">
          <Form action="#Linux"/>
        </span>
        <span id="pi" style={{display:"none"}}>
          <Form action="#Pi"/>
        </span>
        <span id="debian" style={{display:"none"}}>
          <Form action="#Debian"/>
        </span>
        <span id="windiws" style={{display:"none"}}>
          <Form action="#Windiws"/>
        </span>
      </div>
    </div>
    </div>
  <div className="overlay-app" />
  </section>
  )
}
export default setting; 
